@Override
public int hashCode() {
  int result = super.hashCode();
  result = 31 * result  + xPlane.hashCode();
  result = 31 * result  + minYPlane.hashCode();
  result = 31 * result  + maxYPlane.hashCode();
  result = 31 * result  + minZPlane.hashCode();
  result = 31 * result  + maxZPlane.hashCode();
  return result;
}

